import React from "react";
import CargoItem from "./CargoItem";

const CargoList = ({ cargos, updateStatus }) => {
  return (
    <table>
      <thead>
        <tr>
          <th>Номер</th>
          <th>Название</th>
          <th>Статус</th>
          <th>Пункт отправления</th>
          <th>Пункт назначения</th>
          <th>Дата отправления</th>
        </tr>
      </thead>
      <tbody>
        {cargos.map((cargo) => (
          <CargoItem key={cargo.id} cargo={cargo} updateStatus={updateStatus} />
        ))}
      </tbody>
    </table>
  );
};

export default CargoList;
